css:
.editor-colors {
  background-color: #0f1317;
  color: #277faf;
}
.editor .indent-guide {
  border-left: dotted 1px;
  box-shadow: none;
  color: #db7a28;
  opacity: 0.5;
}
.editor .invisible-character {
  color: #586e75;
}
.editor .gutter {
  background-color: #13181d;
}
.editor .gutter .line-number {
  color: #527284;
  opacity: 1;
}
.editor .gutter .line-number.folded,
.editor .gutter .line-number:after,
.editor .fold-marker:after {
  color: #40ff00;
}
.editor .cursor {
  border-color: #ffffff;
}
.editor .selection .region {
  background-color: rgba(100, 156, 212, 0.2);
}
.editor .line-number.cursor-line-no-selection {
  background-color: #1d252d;
}
.bracket-matcher {
  background-color: #948ac4;
  opacity: 0.3;
}
.comment {
  color: #304457;
  font-style: italic;
}
.entity {
  color: #e59d1b;
}
.keyword {
  color: #859900;
}
.storage.type {
  color: #859900;
}
.constant {
  color: #f2ce8d;
}
.constant.numeric,
.constant.boolean {
  color: #bdf223;
}
.variable {
  color: #bdd0de;
}
.delimiter,
.brace {
  color: #5787ab;
}
.delimiter.period {
  color: #859900;
}
.invalid.deprecated {
  text-decoration: underline;
  color: #f4c2c1;
}
.invalid.illegal {
  color: #f4c2c1;
}
.string {
  color: #f74210;
}
.string .constant.character.escape {
  color: #f4c2c1;
}
.string.regexp {
  color: #2aa198;
}
.string.regexp .source.ruby.embedded,
.string.regexp .string.regexp.arbitrary-repitition {
  color: #f4c2c1;
}
.wrap-guide {
  background-color: transparent;
  border-left: dotted 1px #db7a28;
  opacity: 0.5;
}
.json .leading-whitespace + .string,
.json .hard-tab + .string {
  color: #304457;
}
.json .leading-whitespace + .string .punctuation,
.json .hard-tab + .string .punctuation {
  color: #304457;
}
.json .key-value,
.json .pair {
  color: #859900;
}
.json .expected-dictionary-separator {
  color: #9c3f05;
}
.json .constant {
  color: #e59d1b;
}
.php .keyword {
  color: #7fa1d8;
}
.php .keyword.operator {
  color: #90a5c7;
}
.php .entity:not(.inherited-class) {
  color: #bdd0de;
}
.php .type {
  color: #277faf;
}
.php .punctuation:not(.variable),
.php .modifier {
  color: #a0bfcf;
}
.php .punctuation.string {
  color: #f74210;
}
.php .comment,
.php .comment.punctuation {
  color: #000000;
}
.php .phpdoc.keyword {
  color: #1c1717;
  font-style: normal;
}
.php .name.function {
  color: #e59d1b;
}
.php .function-call {
  color: #6e87b6;
}
.php .constant {
  color: #e59d1b;
}
.php .property {
  color: #6e87b6;
}
.php .numeric {
  color: #bdf223;
}
